import React from 'react'
import Button from '@mui/material/Button';
import { useNavigate } from 'react-router-dom'

function home() {

  let navigate = useNavigate();


function hanlde(e) {
  console.log(e)
  navigate("cadastroinstrumento")
}

  return (
    <div>
{/* Header */}

    <header>

    <h1>Cadastro De Clientes</h1>

    <br />
    <br />
    </header>

{/* Main */}

    <main>

    <h2>Cadastrar Intrumento Musical: </h2>
    <br />
    <Button variant="contained" color="success" onClick={hanlde("aqui")} >Cadastrar Instrumento</Button>

    <br />
    <br />

    <h2>Cadastrar Cliente: </h2>
    <Button variant="contained" color="success">Cadastrar Instrumento</Button>

    </main>


    </div>
  )
}

export default home
